import React from 'react';
import './NewsPage.css';  // Ensure this path is correct
import Header from '../../components/Header/Header';
import Footer from '../../components/Footer/Footer';

const NewsPage = () => {
  return (
    <div className="news-page">
      <Header />
      <div className="news-container">
        <h1 className="news-title">Latest News</h1>
        <div className="news-list">
          <div className="news-item">
            <h2>AI Transforming Construction</h2>
            <p>Artificial Intelligence is changing the future of construction...</p>
            <a href="/news/ai-transforming-construction" className="read-more-btn">Read More</a>
          </div>
          <div className="news-item">
            <h2>Latest Trends in Real Estate</h2>
            <p>Smart solutions are reshaping real estate construction...</p>
            <a href="/news/latest-trends" className="read-more-btn">Read More</a>
          </div>
        </div>
      </div>
      <Footer />
    </div>
  );
};

export default NewsPage;
